Data::Data(QObject *parent) :
   QObject(parent),
   zd(nullptr),
   isDXCCQueryValid(false)
{
    FCT_IDENTIFICATION;

    loadContests();
    loadPropagationModes();
    loadLegacyModes();
    loadDxccFlags();
    loadSatModes();
    loadIOTA();
    loadSOTA();
    loadWWFF();
    loadPOTA();
    loadTZ();

    isDXCCQueryValid = queryDXCC.prepare(
                "SELECT "
                "    dxcc_entities.id, "
                "    dxcc_entities.name, "
                "    dxcc_entities.prefix, "
                "    dxcc_entities.cont, "
                "    CASE "
                "        WHEN (dxcc_prefixes.cqz != 0) "
                "        THEN dxcc_prefixes.cqz "
                "        ELSE dxcc_entities.cqz "
                "    END AS cqz, "
                "    CASE "
                "        WHEN (dxcc_prefixes.ituz != 0) "
                "        THEN dxcc_prefixes.ituz "
                "        ELSE dxcc_entities.ituz "
                "    END AS ituz , "
                "    dxcc_entities.lat, "
                "    dxcc_entities.lon, "
                "    dxcc_entities.tz "
                "FROM dxcc_prefixes "
                "INNER JOIN dxcc_entities ON (dxcc_prefixes.dxcc = dxcc_entities.id) "
                "WHERE (dxcc_prefixes.prefix = :callsign and dxcc_prefixes.exact = true) "
                "    OR (dxcc_prefixes.exact = false and :callsign LIKE dxcc_prefixes.prefix || '%') "
                "ORDER BY dxcc_prefixes.prefix "
                "DESC LIMIT 1 "
                );

    isSOTAQueryValid = querySOTA.prepare(
                "SELECT summit_code,"
                "       association_name,"
                "       region_name,"
                "       summit_name,"
                "       altm,"
                "       altft,"
                "       gridref1,"
                "       gridref2,"
                "       longitude,"
                "       latitude,"
                "       points,"
                "       bonus_points,"
                "       valid_from,"
                "       valid_to "
                "FROM sota_summits "
                "WHERE summit_code = UPPER(:code)"
                );

    isPOTAQueryValid = queryPOTA.prepare(
                "SELECT reference,"
                "       name,"
                "       active,"
                "       entityID,"
                "       locationDesc,"
                "       latitude,"
                "       longitude,"
                "       grid "
                "FROM pota_directory "
                "WHERE reference = UPPER(:code)"
                );

    isWWFFQueryValid = queryWWFF.prepare(
                "SELECT reference,"
                "       status,"
                "       name,"
                "       program,"
                "       dxcc,"
                "       state,"
                "       county,"
                "       continent,"
                "       iota,"
                "       iaruLocator,"
                "       latitude,"
                "       longitude,"
                "       iucncat,"
                "       valid_from,"
                "       valid_to "
                "FROM wwff_directory "
                "WHERE reference = UPPER(:reference)"
                );
}

